    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>++ Selamat datang di Project Cross Wiki Yayasan SCP!

Sebuah project dimana penerjemah atau kontributor melakukan pemindahan dan revisi besar-besaran artikel SCP yang sebelumnya sudah diterjemah oleh orang-orang pendahulu Wiki Yayasan SCP diberbagai media sosial!

Ada banyak sekali artikel-artikel SCP Wiki yang sebelumnya pernah diterjemah oleh orang-orang yang ingin membangun komunitas SCP di Indonesia melalui media sosial yang ada seperti Facebook, LINE dan lain-lain. Tentunya kita tidak akan membiarkan usaha mereka sia-sia yang telah membangun komunitas SCP di Indonesia sebelum Wiki Yayasan SCP ini ada, yaitu dengan memindahkan artikel mereka ke dalam katalog Wiki Yayasan SCP.

Prosedur dalam berkontribusi memindahkan artikel yang ada ke dalam Wiki Yayasan SCP sama seperti prosedur menerjemahkan artikel SCP biasanya. Kalian pindahkan artikel tersebut ke dalam [[[http://scp-id-sandbox.wikidot.com/ | Sandbox]]] milik kalian, melakukan pengoreksian tatanan bahasa, grammar dan lain-lain dari artikel yang ada dan mengontak [[[http://scp-idn.wikidot.com/sastrawan-penggatak-pustaka | Reviewer]]] untuk mereka cek apa artikel tersebut sudah cukup dan pas untuk dimasukkan ke dalam Wiki Yayasan SCP!

**Perlu diketahui artikel-artikel yang ada dibawah ini kemungkinan besar sudah //outdated//, banyak SPaG error dan format yang perlu dikoreksi.**

Jika ada pertanyaan lebih lanjut terkait Project ini atau petunjuk lebih lanjut dalam berkontribusi, silahkan hubungi [[*user nahyesq]] di PM Wikidot atau [[[https://discord.gg/TBAQ4UwsXK | di Server Discord SCP Foundation Indonesia]]]

++ Perhatian!

Bagi kalian yang ingin mengambil sebuah artikel untuk dikoreksi dan diajukan ke Wiki Yayasan SCP, diharapkan kalian untuk meninggalkan jejak di artikel yang ingin dikerjakan dengan mengisi kolom &#34;Diambil oleh&#34; dengan nama Wiki kalian, contohnya:

|| [[[SCP-6666]]] || [[[www.facebook.com | Link]]] || Zalgo || [[*user nahyesq]] ||

&gt; @@|| [[[SCP-6666]]] || [[[www.facebook.com | Link]]] || Zalgo || [[*user nahyesq]] ||@@
